import React from "react";
import { NavLink } from "react-router-dom";
import Button from "../components/lib/Button";

export const Home = () => {
  return (
    <div>
      <p className="pt-5">WELCOME</p>
      <h1>We Are The MERN Developer</h1>
      <NavLink to="/ab">
        <Button type="submit"  />
      </NavLink>
    </div>
  );
};
